weaknesses:
Touch-to-toe time needs to be a shade quicker.
Hasn’t had to punt in inclement weather often.&nbsp;
Punter-only with no kickoff experience.

strengths:
Three-year starter and team captain.
Has plenty of experience in pro passing concepts.&nbsp;
Patient to wait out the route development.&nbsp;
Throws with adequate timing into intermediate windows.
Good eye manipulation to move zone defenders away from his target.
Keeps eyes alive and searching for a completion when scrambling.

weaknesses:
Ducks head and drops eyes, driving into run blocks.&nbsp;
Short arms will get him crowded at the point of attack.
Average pursuit speed out to the flanks.
Will take some plays off when action doesn’t come his way.&nbsp;
Counters don't come naturally at the top of the rush.&nbsp;
Average closing burst to the quarterback.&nbsp;

Doesn't have much knock-back pop into initial contact.&nbsp;
Can be extended and pulled off-balance by salty two-gappers.&nbsp;
Average snap-to-step quickness to slide laterally and slow A-gap shots.
Can be impatient climbing and stalking second-level linebackers.
Beat to the punch at times due to below-average arm length.&nbsp;
Has some trouble protecting his edges in pass pro.

Instincts and recognition of blocking schemes are average.&nbsp;
Climbing blockers tend to stick to him once they land.
Below-average block-slipper in space.
Struggles to consistently square up tackle targets.&nbsp;
Excessive arm tackling leads to high miss count.
